import React from 'react';

class ActionButtons extends React.Component
{
    render() {
        return (
            <div>
                <button type="button" className="btn btn-primary m-3" onClick={() => {this.props.callPostAPI()}} style={{width:"500px"}}>Solve</button>
                <br/>
                <button type="button" className="btn btn-danger m-3" onClick={() => {this.props.clearGrid()}} style={{width:"200px"}}>Clear Grid</button>
                <button type="button" className="btn btn-info m-3" onClick={() => {this.props.newRandomGrid()}} style={{width:"200px"}}>New Random Grid</button>
            </div>
        );
    }
}

export default ActionButtons;
